      "timestamp": "2023-10-01 12:00",
      "body": "Hi Daniel,\n\nThank you for your message. The equation n=1-sqrt(1-f)/2 is a very general one. It can be found in most books on electromagnetism and optics. I wrote down the reference where I first came across this equation in my Nature paper. Have a look at page 3. But you can also find it in more recent books on plasmonics. For example, in a book by Jain.\n\nBest regards,\nWim"
    },
    {
      "from": "daniel.scott@example.com",
