      "timestamp": "2023-10-02 09:00",
      "body": "Hi Wim,\n\nDo you have any notes or references for the derivation of the equation, f2=1-2n, when n=4*Pi/lambda*d*n*d?\n\nThanks,\nDaniel"
    },
