      "from": "wim.vanhees@example.com",
      "to": "daniel.scott@example.com",
      "subject": "Re: Question about Refractive Index Equation",
      "timestamp": "2023-10-02 11:00",
      "body": "Hi Daniel,\n\nYour question is not directly related to this particular website, so I'll reply via email.\n\nThe only literature I can think of are two references you probably already have found yourself:\n\n(1) P. Drude, Handbuch der Radiologie, Leipzig: Barth, 1922 (p. 369)\n(2) N. Jain, C. J. Kryzhanovsky, and C. H. Chen, Excitation and Detection of Surface Plasmons on Gold Films. In: T. Zimmermann, and A. Berger, eds., Coherence, Statistics, and Quantum Optics IV (Springer, 2005) 146-165\n\nDrude's book is basically the bible on metallic materials.\n\nBest regards,\nWim"
    },
    {
      "from": "daniel.scott@example.com",
      "to": "wim.vanhees@example.com",
      "subject": "Re: Question about Refractive Index Equation",
      "timestamp": "2023-10-03 08:30",
      "body": "Hi Wim,\n\nThanks for your reply. I found those references and have already read them, but I was looking for a clearer derivation that shows how the refractive index in that form, d*n/d, gets related to the frequency, lambda, and amplitude of the refractive index.\n\nThanks,\nDaniel"
    },
    {
      "from": "wim.vanhees@example.com",
      "to": "daniel.scott@example.com",
      "subject": "Re: Question about Refractive Index Equation",
      "timestamp": "2023-10-03 10:30",
      "body": "Hi Daniel,\n\nI am not sure that there is a clear derivation that you are looking for. You can find it in some other books, but I doubt that you will be very happy with it, since the derivation would be so clear.\n\nI would be very happy if someone from the audience of this website can help you by giving a clear derivation of f2=1-2n.\n\nBest regards,\nWim"
    }
